'''Dennis Oliech''' (born on 2 February 1985) is a [[Kenya]]n professional [[Association football|football]] forward currently playing for [[AJ Auxerre|Auxerre]].
== Club career == Dennis Oliech started playing football for [[Dagoretti Santos]] in his earlier years, then [[Mathare United]].
He turned professional in 2003 playing for [[Al-Arabi SC (Qatar)|Al-Arabi]] in [[Qatar]] until late 2005. In 2004 he was offered to change his citizenship form Kenyan to Qatari. but he refused the offer.<ref>{{cite news |url=http://allafrica.com/stories/200402040383.html |title=It's OK For Oliech to Hold Out For a Better Deal |format=reprint, registration & fee required |newspaper=The East African Standard |location=Kenya |publisher=allAfrica |date=2 February 2004 |accessdate=16 November 2011 }}</ref>
In 2005, Oliech signed a four-year contract with the French Ligue 1 team [[FC Nantes]] and started playing for them at the start of 2006. However, FC Nantes were relegated in 2007 after finishing bottom of Ligue 1 and Oliech was signed on loan by [[AJ Auxerre|Auxerre]] who were in need of goals after a bad start to their season. In January Auxerre signed him from Nantes. On September 25th 2011, Oliech scored his first ever hat-trick for Auxerre in a 4â1 win over Sochaux. The hat-trick was accomplished within the span of 16 minutes.
== International career == His first international match was in 2002, when [[Kenya national football team|Kenya]] lost to [[Nigeria national football team|Nigeria]] 3â0.
Having come on in the second half Oliech scored which was the winning goal for the national team in the [[African Cup of Nations]] qualifiers for the 2004 finals against [[Cape Verde national football team|Cape Verde Islands]]. He played at the [[2004 African Cup of Nations]]. This was the same year he was voted as one of the most promising talents alongside [[Wayne Rooney]] of [[Manchester United F.C.|Manchester United]].
